INSERT INTO public.post
(titulo, descricao, datapostagem, dataatualizacao, conteudo, imagem)
VALUES('Dia de Mustang: aceleramos o novo V8 e o Mach-E 100% elétrico na pista', 'Durante nossa visita recente ao centro de desenvolvimento e testes da Ford na cidade de Tatuí, em SP, tivemos a chance imperdível de levar duas feras da gama atual da marca para a pista de testes: o novo Mustang GT e o inédito Mustang Mach-E.', '2024-09-20 00:00:00.000', '2024-09-20 00:00:00.000', 'A ideia inicial, obviamente, era testar a performance dos modelos em um ambiente sem as amarras das ruas, afinal, trata-se de um circuito fechado e monitorado, o que possibilita que o potencial máximo do veículo seja explorado. Além disso, foi a chance de experimentar algumas das soluções tecnológicas disponíveis para ambos.
O primeiro teste foi com o novo Mustang, lançado no Brasil em março desse ano. Disponível unicamente na versão GT Performance, traz motor 5.0 V8 aspirado de até 488cv e 58kgfm, números suficientes para levá-lo de 0 a 100km/h em 4,3 segundos. A tração é unicamente traseira e o esportivo vem com câmbio automático de dez velocidades.

O mais interessante é que, embora seja um carro moderno, o Mustang mantém a alma e a diversão dos clássicos. O V8 borbulhando em marcha lenta pode ficar mais calmo ou (bem) mais agressivo através do seletor de modos de condução; na ocasião, deixamos no modo Pista que é onde o carro fica mais agressivo e o ronco, por consequência, mais encorpado.', decode('','hex'));
INSERT INTO public.post
(titulo, descricao, datapostagem, dataatualizacao, conteudo, imagem)
VALUES('Conheça o lêmure, o primata de Madagascar', 'Entre os animais exóticos que você precisa conhecer, o lêmure é um dos mais interessantes. Afinal, os olhos marcantes chamam a atenção até daqueles que não são entusiastas dos primatas.', '2024-09-19 00:00:00.000', '2024-09-20 00:00:00.000', 'Lêmure é o nome dado aos primatas de Madagascar da ordem Lemuriforme. Sendo primata, tem características semelhantes aos macacos. Existem espécies de lêmures herbívoros e onívoros.

Todos possuem polegar opositor e unhas em vez de garras. As caudas são longas, mas nunca preênseis. Locomovem-se saltando entre os galhos das árvores. A variação no peso é enorme, desde 30 g até 10 kg. O ancestral já extinto pesava 240 kg.', decode('','hex'));
INSERT INTO public.post
(titulo, descricao, datapostagem, dataatualizacao, conteudo, imagem)
VALUES('Google lança ferramenta capaz de traduzir hieróglifos egípcios', 'A Google anunciou uma nova ferramenta de aprendizado de máquina que permite a qualquer pessoa conhecer e explorar hieróglifos egípcios, sistema de escrita usado há mais de 4 mil anos.', '2024-09-20 00:00:00.000', '2024-09-20 19:04:52.961', 'A novidade foi lançada em comemoração aos 221 anos da descoberta da Pedra de Roseta, pedaço de granito que permitiu desvendar os significados dessa linguagem.

Intitulado ''Fabricius'', o tradutor de hieróglifos online está integrado ao Google Arts & Culture, plataforma de visitas virtuais a algumas das maiores galerias de arte do mundo. Com ele, é possível descobrir os mistérios da língua histórica por meio de três caminhos.

No primeiro, há uma breve apresentação da história dos hieróglifos, dividida em seis passos. Em seguida, o usuário é convidado pela inteligência artificial a traduzir as próprias palavras e expressões para a linguagem antiga e compartilhá-las com seus contatos. Já o último é a possibilidade de usar a tecnologia para pesquisas acadêmicas.', decode('','hex'));
INSERT INTO public.post
(titulo, descricao, datapostagem, dataatualizacao, conteudo, imagem)
VALUES('Curiosidades do Egito - mitos, deuses e os segredos das pirâmides', 'O Egito é berço de inesgotáveis mitos e fontes de fascinação. O valor histórico da sua cultura já serviu de inspiração para documentaristas, diretores, artistas e cientistas em diversas produções.', '2024-09-20 00:00:00.000', '2024-09-20 00:00:00.000', 'No entanto, apesar da vastidão dos seus atrativos, duas temáticas são recorrentes entre quem busca alimentar a curiosidade que os egípcios despertam: a mitologia e suas imponentes pirâmides.
O Guia mitológico do Antigo Egito – da historiadora de arte da Universidade de Málaga, na Espanha, Raquel García García – descreve a mitologia egípcio como "realmente extensa e com numerosas variantes”.', decode('','hex'));
INSERT INTO public.post
(titulo, descricao, datapostagem, dataatualizacao, conteudo, imagem)
VALUES('Microsoft vai ''alugar'' usina nuclear nos EUA para energizar servidores de IA', 'A Microsoft fechou um acordo de 20 anos para o fornecimento de energia da usina nuclar de Three Mile Island, nos Estados Unidos. O local será usado para alimentar os servidores de inteligência artificial (IA) da companhia.', '2024-09-20 00:00:00.000', '2024-09-20 00:00:00.000', 'A ideia da Microsoft é ''alugar'' toda a operação da Unit 1 da usina, que tem fornecimento de energia de aproximadamente 835 megawatts — o suficiente para garantir a eletricidade de cerca de 800 mil casas. A energia seria distribuída para data centers nas regiões norte-americanas de Chicago, Virginia, Pensilvânia e Ohio, e o processo ainda deve gerar cerca de 3,4 mil empregos diretos e indiretos. O acordo foi confirmado pela Constellation, atual dona da usina, mas ainda depende da aprovação de órgãos reguladores. Se todas as etapas burocráticas forem superadas, a operação do reator começa apenas em 2028. A ideia da Microsoft é ter energia para os servidores de IA a partir de fontes mais limpas de energia, o que inclui o uso de usinas nucleares.', decode('','hex'));
INSERT INTO public.post
(titulo, descricao, datapostagem, dataatualizacao, conteudo, imagem)
VALUES('ONU pede que IA seja tratada com mesma urgência de mudanças climáticas', 'Um órgão consultor ligado às Organizações das Nações Unidas (ONU) fez uma série de recomendações sobre o futuro da inteligência artificial (IA) na sociedade.', '2024-09-18 00:00:00.000', '2024-09-20 00:00:00.000', 'O relatório completo inclui alertas sobre riscos e sugestões para ações governamentais.

O comitê escolhido para lidar sobre o tema diz que o assunto não é monitorado como deveria pela ONU. Ele pede que os riscos da IA sejam tratados com seriedade e de uma forma tão completa quanto as mudanças climáticas — um tema que por anos foi negligenciado e só agora, com problemas sentidos na prática, está se popularizando.
O documento traz algumas sugestões e recomendações para a ONU envolvendo riscos como a criação automatizada de desinformação, a criação de deepfakes cada vez mais realistas, a substituição de empregos e o viés algorítmico de IAs generativas.', decode('','hex'));
INSERT INTO public.post
(titulo, descricao, datapostagem, dataatualizacao, conteudo, imagem)
VALUES('A IA ''não se importa tanto com a gente'', afirma especialista em tecnologia', 'Muitas pessoas acreditam que a inteligência artificial pode representar riscos para o futuro da humanidade, mas esse não parece ser o caso do especialista em segurança da informação e tecnologia, Mikko Hyppönen.', '2024-09-18 16:07:24.887', '2024-09-20 00:00:00.000', 'Para ele, a IA não estaria interessada em interferir na vida dos humanos.
Uma das maiores autoridades do mundo em tecnologia, o finlandês abordou o assunto durante sua palestra na 10ª edição do Mind The Sec, maior evento de cibersegurança da América Latina. A apresentação do autor de best-sellers aconteceu no Transamérica Expo Center, em São Paulo, na quinta-feira (19).', decode('','hex'));